INSERT [dbo].[TrainingCourses] ([Id], [Title], [ShortDescription], [Hourse], [PriceForOrganizations], [PriceForIndividuals], [CostOfOneHourForOrganizations], [CostOfOneHourForIndividuals], [LevelOfDifficulty], [RequiredPreliminaryPreparation], [MandatoryPreliminaryPreparation], [IdObject], [MoodleId]) VALUES (1, N'Разработчик .NET приложений', N'Как стать профессионалом,  работать в хорошей компании и получать достойную оплату? Многие начинающие программисты не знают, с чего начать. Если Вы решили обучиться программированию и стать профессиональным разработчиком, прежде всего, следует помнить, чтобы стать высококлассным профессионалом, Вам сначала придется сконцентрировать свои усилия на чем-то одном. .NET Framework – программная платформа, разработанная компанией Microsoft. Платформа позволяет создавать приложения различного типа, работающие на различных устройствах и в различных средах. При этом .NET Framework ориентирована на создание приложений, работающих  под управлением семейства операционных систем Microsoft Windows.

Разработчики программного обеспечения неизменно занимают первые места рейтинга лучших профессий в IT отрасли.  Программистов, которые используют возможности и инструменты .NET Framework часто называют .NET разработчиками. Стать специалистом можно за 4 - 5 месяцев, но важно правильно спланировать обучение.', 144, 18000.0000, 14000.0000, 125.0000, 98.0000, 8, N'Основы программирования', N'ООП', NULL, 2)
